import { useWeb3Context } from 'web3-react';
import logo from './logo.svg';
import TokenMinter from './contracts/TokenMinter.json'
import './App.css';

async function App() {
  const context = useWeb3Context()
  const web3 = new Web3(new Web3.providers.HttpProvider("https://rinkeby.infura.io/v3/9b11910966d3430e9846e504d5847593"))
  const tokenMinterAddress = '0x19A5A6878e66e5E12F04114ca5ef8e94919Ac9C8'
  console.log(tokenMinterAddress)
  const tokenMinterContract = await new web3.eth
      .Contract(TokenMinter.abi, tokenMinterAddress)
  console.log(tokenMinterContract)

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <p>
          {context.account}
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
